bool check(int x) {
    if(x == 1) return false;
    string s = to_string(x);
    int sum = 0;
    for(int i = 0; i < s.size(); i++) {
        if(i % 2 == 0) sum += s[i] - '0';
        else sum -= s[i] - '0';
    }
    if(sum == 1) return true;
    return false;
}
int main() {
    ios_base::sync_with_stdio(false);
    cin.tie(0);
    cout.tie(0);
    int a, b;
    cin >> a >> b;
    int pw = 10, ans = 0;
    for(int i = 1; i <= 8; i++) {
        for(int j = pw; j < pw * 10; j += 11) {
            if(j > b) break;
            if(check(j) == true and a <= j and j <= b) ans ++;

        }
        pw *= 10;
    }
    cout << ans;
}
